package com.elammari.leadExtractor;

import org.springframework.web.bind.annotation.GetMapping;
import org.springframework.web.bind.annotation.PostMapping;
import org.springframework.web.bind.annotation.RequestBody;
import org.springframework.web.bind.annotation.RestController;
import org.springframework.web.multipart.MultipartFile;
import sun.misc.BASE64Decoder;

import java.io.*;
import java.util.regex.Matcher;
import java.util.regex.Pattern;

@RestController
public class Controller {
    @GetMapping("/card")
    public String[] card(){
        String[] myArray= new String[3];
        myArray[0] = "Cat";
        myArray[1] = "Dog";
        myArray[2] = "Elephant";
      return myArray;
    }

   @PostMapping("/card")
    public Image card(@RequestBody  String[] img) throws Exception {
       Image image=new Image();
       String imo="";
       MultipartFile m= base64ToMultipart(imo);
        File file = convertMultiPartToFile(m);
       String value = ImageParse.parseImage(file.getPath());
       System.out.println(value);
       image.name=extractName(value);
       image.email=extractEmail(value);
       image.phone=extractPhone(value);
       image.webSite=extractWebSite(value);
       return image;

   }

    private File convertMultiPartToFile(MultipartFile file ) throws IOException
    {
        File convFile = new File( file.getOriginalFilename() );
        FileOutputStream fos = new FileOutputStream( convFile );
        fos.write( file.getBytes() );
        fos.close();
        return convFile;
    }

    public static MultipartFile base64ToMultipart(String base64) {
        try {
            //String[] baseStrs = base64.split(",");

            BASE64Decoder decoder = new BASE64Decoder();
            byte[] b = new byte[0];
            b = decoder.decodeBuffer(base64);

            for (int i = 0; i < b.length; ++i) {
                if (b[i] < 0) {
                    b[i] += 256;
                }
            }

            return new BASE64DecodedMultipartFile(b, base64);
        } catch (IOException e) {
            e.printStackTrace();
            return null;
        }
    }

    public String extractName(String str){
        System.out.println("Getting the Name");
        final String NAME_REGEX = "([A-Z][a-z]+(?: [A-Z]\\.)? [A-Z][a-z]+)";
        Pattern p = Pattern.compile(NAME_REGEX);
        Matcher m =  p.matcher(str);
        if(m.find()){
            return m.group();
        }
        return "";
    }

    public String extractEmail(String str) {
        System.out.println("Getting the email");
        final String EMAIL_REGEX = "[a-z0-9._%+-]+@[a-z0-9.-]+\\.[a-z]{2,3}";
        Pattern p = Pattern.compile(EMAIL_REGEX);
        Matcher m = p.matcher(str);   // get a matcher object
        if(m.find()){
            return m.group();
        }
        return "";

    }

    public String extractPhone(String str){
        System.out.println("Getting Phone Number");
        Pattern p1 = Pattern.compile("\\d{10}");
        Pattern p2 = Pattern.compile("\\d{3}-\\d{3}-\\d{4}\\s(x|(ext))\\d{3,5}");
        Pattern p3 = Pattern.compile("\\d{3}[-\\.\\s]\\d{3}[-\\.\\s]\\d{4}");
        Matcher m1 = p1.matcher(str);
        Matcher m2 = p2.matcher(str);
        Matcher m3 = p3.matcher(str);

        while (m1.find()) {
            String phone1 = m1.group();
            if (phone1 != null) {
                return phone1;
            }
        }
        while (m2.find()) {
            String phone2 = m2.group();
            if (phone2 != null) {
                return phone2;
            }
        }
        while (m3.find()) {
            String phone3 = m3.group();
            if (phone3 != null) {
                return phone3;
            }

        }
        return null;
    }
    public String extractWebSite(String str){
        System.out.println("Getting WebSite");
        Pattern p1 = Pattern.compile("(https?:\\/\\/)?(www\\.)[-a-zA-Z0-9@:%._\\+~#=]{2,256}\\.[a-z]{2,4}\\b([-a-zA-Z0-9@:%_\\+.~#?&//=]*)|(https?:\\/\\/)?(www\\.)?(?!ww)[-a-zA-Z0-9@:%._\\+~#=]{2,256}\\.[a-z]{2,4}\\b([-a-zA-Z0-9@:%_\\+.~#?&//=]*)");
        Matcher m1 = p1.matcher(str);

        while (m1.find()) {
            String phone1 = m1.group();
            if (phone1 != null) {
                return phone1;
            }
        }
        return null;
    }


}
class Image{
    public String name;
    public String email;
    public String phone;
    public String webSite;


}

 class BASE64DecodedMultipartFile implements MultipartFile {

    private final byte[] imgContent;
    private final String header;

    public BASE64DecodedMultipartFile(byte[] imgContent, String header) {
        this.imgContent = imgContent;
        this.header = header.split(";")[0];
    }

    @Override
    public String getName() {
        // TODO - implementation depends on your requirements
        return System.currentTimeMillis() + Math.random() + "." + header.split("/")[1];
    }

    @Override
    public String getOriginalFilename() {
        // TODO - implementation depends on your requirements
        return System.currentTimeMillis() + (int)Math.random() * 10000 + "." + header.split("/")[1];
    }

    @Override
    public String getContentType() {
        // TODO - implementation depends on your requirements
        return header.split(":")[1];
    }

    @Override
    public boolean isEmpty() {
        return imgContent == null || imgContent.length == 0;
    }

    @Override
    public long getSize() {
        return imgContent.length;
    }

    @Override
    public byte[] getBytes() throws IOException {
        return imgContent;
    }

    @Override
    public InputStream getInputStream() throws IOException {
        return new ByteArrayInputStream(imgContent);
    }

    @Override
    public void transferTo(File dest) throws IOException, IllegalStateException {
        new FileOutputStream(dest).write(imgContent);
    }
}